    [],nt"num_tags": 4,nt"name": "narrative-report-bombay-hook-national-wildlife-refuge-january-april-1957",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Bombay Hook NWR
    outlines Refuge accomplishments from January through April of 1957. The report begins
    by summarizing the weather conditions and water conditions during this period. Wildlife-
    including migratory birds, upland game birds, big game animals, furbearers, predators,
    rodents, mammals, and raptors- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, and collections and receipts.
    A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, hunting, and fishing. N-R forms and photographs are attached.",nt"owner_org":
